import Fetch from 'isomorphic-unfetch';
import Link from 'next/link';

const News = props => (
  <div>
    <p>{props.newsList.totalResults}</p>
    {props.newsList.articles.map((e, index) => (
      <div key={index}>
        <p className="list-group">
          <li className="list-group-item">{`Title: ${e.title}`}</li>
          <li className="list-group-item">{`Author: ${e.author}`}</li>
        </p>
        <br />
      </div>
    ))}
  </div>
);
export default News;
